import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from "@mui/material";
import LoanIconButton from "../../Common/LoanIconButton";
import CompanyModal from "../Common/CompanyModal";
import { RiSkipBackMiniFill } from "react-icons/ri";
import { BsPlus } from "react-icons/bs";
import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
import { useState } from "react";
import { IoRefresh } from "react-icons/io5";
import LoanTextField from "../../Common/LoanTextField";
import { Link } from "react-router-dom";
import { useParams } from "react-router-dom";

const AddCompanyAddress = ({
  submitted,
  newAddress,
  address,
  country,
  region,
  handleInputChangeAdress,
  handleBack,
  handleSkip,
  handleNext,
  saveAddress,
  handlePrevios
}) => {
  const [isCompanyAddressModalOpen, setIsCompanyAddressModalOpen] =
    useState(false);
  function handleCompanyAddressOpenModal() {
    setIsCompanyAddressModalOpen(true);
  }
  function handleCompanyAddressCloseModal() {
    setIsCompanyAddressModalOpen(false);
  }
  const { companyId } = useParams();

  return (
    <>
      <div className="flex">
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipPrevious />}
          text="Back"
          onClick={handleSkip}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BsPlus />}
          text="Add"
          onClick={handleCompanyAddressOpenModal}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipNext />}
          text="Skip"
          onClick={handleSkip}
        />


<Link to={`/Account/${companyId}`}>
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipPrevious />}
            text="Account Information"
            onClick={handlePrevios}
          />
        </Link>
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BsPlus />}
          text="Add"
          onClick={handleCompanyAddressOpenModal}
        />
        <Link to={`/trade/${companyId}`}>
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipNext />}
            text="Trade Registration"
            onClick={handleSkip}
          />
        </Link>
      </div>
      <CompanyModal
        isOpen={isCompanyAddressModalOpen}
        onClose={handleCompanyAddressCloseModal}
        title="Add company address information"
      >
        <div>
          <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
            <FormControl variant="standard" sx={{ width: "45ch" }}>
              <InputLabel id="countrylbl" color="secondary">
                Country
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => (address.CountryID = event.target.value)}
                labelId="countrylbl"
                id="countrySelect"
                label="Country"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {country.map((newContry) => (
                  <MenuItem
                    key={newContry.Id}
                    CountryID={newContry.Id}
                    value={newContry.Id}
                  >
                    {newContry.Name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            <FormControl variant="standard">
              <InputLabel id="regionlbl" color="secondary">
                Region
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => (address.RegionID = event.target.value)}
                labelId="regionlbl"
                id="regionSelect"
                label="Region"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {region.map((newRegion) => (
                  <MenuItem
                    key={newRegion.Id}
                    RegionID={newRegion.Id}
                    value={newRegion.Id}
                  >
                    {newRegion.Name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>

            <LoanTextField
              id="ZoneSubCity"
              label="Zone Sub City"
              value={address.ZoneSubCity}
              onChange={handleInputChangeAdress}
              name="ZoneSubCity"
            />
            <LoanTextField
              id="Woreda"
              label="Woreda"
              value={address.Woreda}
              onChange={handleInputChangeAdress}
              name="Woreda"
            />
            <LoanTextField
              id="City"
              label="City"
              value={address.City}
              onChange={handleInputChangeAdress}
              name="City"
            />
            <LoanTextField
              id="Kebele"
              label="Kebele"
              value={address.Kebele}
              onChange={handleInputChangeAdress}
              name="Kebele"
            />
            <LoanTextField
              id="HouseNo"
              label="HouseNo"
              value={address.HouseNo}
              onChange={handleInputChangeAdress}
              name="HouseNo"
            />
            <LoanTextField
              id="BuildingNo"
              label="BuildingNo"
              value={address.BuildingNo}
              onChange={handleInputChangeAdress}
              name="BuildingNo"
            />
            <LoanTextField
              id="StreetAddress"
              label="StreetAddress"
              value={address.StreetAddress}
              onChange={handleInputChangeAdress}
              name="StreetAddress"
            />
          </div>
          <div className="flex justify-center p-2 pt-5">
            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                saveAddress();
              }}
            >
              Save
            </button>
          </div>
        </div>
      </CompanyModal>
    </>
  );
};

export default AddCompanyAddress;
